import './App.css';
import Header from './Components/Header';
import {Routes,Route} from 'react-router-dom'
import Home from './Components/Home';
function App() {
  return (
    <div className="App">
      <Header/>
      <Routes>

        <Route path='/' element={<Home/>}/>
        <Route path='/home' element={<Home/>}/>

      </Routes>
    </div>
  );
}

export default App;
